let express = require("express");

let app = express();

app.use(express.json());

let products =[
    {pid:100,pname:"Tv",price:120000,url:"data:image/jpeg;base64,"},
    {pid:101,pname:"Mobile",price:55000,url:"data:image/jpeg;base64,"}
]

// get all product details
// http://localhost:9090/allProducts

app.get("/allProducts",(req,res)=> {
    res.json(products);
})

// get product inform base upon the id
// http://localhost:9090/findProduct/100 
app.get("/findProduct/:pid",(req,res)=> {
    let pid = req.params.pid;
    let result = products.find(p=>p.pid==pid);
    if(result==undefined){
            res.json({"msg":"Product details not present with pid "+pid})
    }else {
            res.json(result);
    }
})

// store the product details 
// http://localhost:9090/storeProduct 
app.post("/storeProduct",(req,res)=> {
    let product = req.body;
    let result = products.find(p=>p.pid==product.pid);
    if(result==undefined){
            products.push(product);
            res.json({"msg":"Product details stored successfully"})
    }else {
            res.json({"msg":"Product id must be unique"});
    }
})
// http://localhost:9090/updateProduct 
app.patch("/updateProduct",(req,res)=> {
    let product = req.body;
    let index = products.findIndex(p=>p.pid==product.pid);
    if(index<0){
        res.send({"msg":"Product not present"})
    }else {
        products[index].price = product.price;
        res.send({"msg":"Product price updated successfully"})
    }
})

// delete product using pid
// http://localhost:9090/deleteProduct/100
app.delete("/deleteProduct/:pid",(req,res)=> {
    let pid = req.params.pid;
    let index = products.findIndex(p=>p.pid==pid);
    if(index<0){
        res.send({"msg":"Product not present"})
    }else {
        products.splice(index,1);   // index position and number of reocrds. 
        res.send({"msg":"Product details deleted successfully"})
    }
})

app.listen(9090,()=>console.log("Server running on port number 9090"))